import React, { ReactElement } from "react";
import styled from "styled-components/native";
import { SafeAreaView } from "react-native-safe-area-context";

interface Props {}

export default function Timeline({}: Props): ReactElement {
  return (
    <Styled.container>
      <Styled.info>
        <Styled.infoIcon source="../../assets/FM/icons/info.png" />
      </Styled.info>
      <Styled.availability>
        <Styled.availabilityHeading>
          When are you easiliy available for the people in your life?
        </Styled.availabilityHeading>
      </Styled.availability>
    </Styled.container>
  );
}

const Styled = {
  container: styled(SafeAreaView)`
    flex: 1;
  `,
  availabilityHeading: styled.Text`
    font-family: "Lexend_400Regular";
    font-style: normal;
    font-weight: 700;
    font-size: 17px;
    color: #2e303a;
  `,
  info: styled.View``,
  infoIcon: styled.Image``,
  availability: styled.View`
    min-width: 320px;
    width: 100%;
    background-color: #fff;
    box-shadow: 0px 8px 40px rgba(66, 83, 146, 0.12);
    border-radius: 12px;
    height: 234px;
    margin: 20px auto;
  `,
};
